import React from 'react';
function Experience() {
  return (
    <div>
      <h2>Experience</h2>
      <ul>
        <li><strong>Company A</strong> – Developer (2022–2023)</li>
        <li><strong>Company B</strong> – Intern (2021)</li>
      </ul>
    </div>
  );
}
export default Experience;
